/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `insert_backlog_trigger` AFTER INSERT ON `results` FOR EACH ROW BEGIN
  IF NEW.Mode = 'REG' AND NEW.remarks = 'Fail' THEN
    INSERT INTO backlogs (PIN, sub_id, sem, Marks,Period,MODE, Status)
    VALUES (NEW.PIN, NEW.sub_id, NEW.sem, NEW.Marks,NEW.Period,NEW.MODE, 'Active');
  ELSEIF NEW.Mode = 'SUP' AND NEW.remarks='Pass' THEN
    UPDATE backlogs
    SET Status = 'Inactive'
    WHERE PIN = NEW.PIN AND sub_id = NEW.sub_id;
    
  ELSEIF NEW.Mode = 'SUP' AND NEW.remarks='Fail' THEN
    UPDATE backlogs
    SET marks = NEW.marks, period = NEW.period, mode = 'SUP'
    WHERE PIN = NEW.PIN AND sub_id = NEW.sub_id AND NEW.remarks = 'Pass';
  END IF;
END */;;
